INSERT INTO [dbo].[GALLERY_ITEM] ([Gallery_Item_Guid], [Icon_File_Name_Small], [Icon_File_Name_Large], [Configuration_Setup], [Description], [Configuration_Setup_Client], [Title], [Is_Visible], [CreationDate]) VALUES ('4737748d-c762-4459-bc76-393e816c6a2d', N'NCSF_V1.png', N'NCSF_V1.png', N'{"Sets":["NCSF_V2"], "SALLevel":"Low", "QuestionMode":"Requirements Only"}', N'This is the public draft of the NIST Cybersecurity Framework (CSF or Framework) 2.0. The Framework has been used widely to reduce cybersecurity risks since its initial publication in 2014. Many organizations have told NIST that CSF 1.1 remains an effective framework for addressing cybersecurity risks. There is also widespread agreement that changes are warranted to address current and future cybersecurity challenges and to make it easier for organizations to use the Framework. NIST is working with the community to ensure that CSF 2.0 is effective for the future while fulfilling the CSFs original goals and objectives. NIST seeks feedback on whether this draft revision addresses organizations current and anticipated future cybersecurity challenges, is aligned with leading practices and guidance resources, and reflects comments received so far. In addition, NIST requests ideas on the best way to present the modifications from CSF 1.1 to CSF 2.0 to support transition. NIST encourages concrete suggestions for improvements to the draft, including revisions to the narrative and Core.', NULL, N'The NIST Cybersecurity Framework 2.0 - Initial Public Draft', 1, '2023-10-02 14:08:13.580')
INSERT INTO [dbo].[GALLERY_ITEM] ([Gallery_Item_Guid], [Icon_File_Name_Small], [Icon_File_Name_Large], [Configuration_Setup], [Description], [Configuration_Setup_Client], [Title], [Is_Visible], [CreationDate]) VALUES ('2ebb851a-9a93-455e-9c12-6f0ee6ea6673', NULL, NULL, N'{"Sets":[]}', N'Temp holder for orphan assessments', NULL, N'Tmp Holder', 0, '2023-06-21 13:14:42.187')
