INSERT INTO [dbo].[GALLERY_ITEM] ([Gallery_Item_Guid], [Icon_File_Name_Small], [Icon_File_Name_Large], [Configuration_Setup], [Description], [Configuration_Setup_Client], [Title], [Is_Visible], [CreationDate]) VALUES ('9219f73d-a9ec-4e13-b884-ca1677bac576', N'CyberFlorida.png', N'CyberFlorida.png', N'{"Sets":["Florida_NCSF_V1"], "QuestionMode": "Requirements Only", "Model":{"ModelName":"RRA", "Submodel": "RRA CF"}, "Origin":"CF"}', N'Please Start Here.  This is a small, easy to complete, entry level version of the Cyber Florida Full Assessment.  This module can be upgraded later to the full assessment. This module was developed on behalf of The Florida Center for Cybersecurity (Cyber Florida). Cyber Florida was created by the State in 2014 to help Florida become a national leader in cybersecurity education, academic and practical research, and community outreach and engagement. The module includes the Ransomware Readiness Assessment and NISTs Cybersecurity Framework requirements.', NULL, N'Cyber Florida Entry Assessment', 1, '2022-10-05 11:21:37.917')
