INSERT INTO [dbo].[GEN_FILE] ([Gen_File_Id], [File_Type_Id], [File_Name], [Title], [Name], [File_Size], [Doc_Num], [Comments], [Description], [Short_Name], [Publish_Date], [Doc_Version], [Summary], [Source_Type], [Data], [Is_Uploaded]) VALUES (691, 31, N'CSF 2.0 Core with Examples Discussion Draft[74].pdf', N'The NIST Cybersecurity Framework 2.0 - Implementation Examples', N'The NIST Cybersecurity Framework 2.0 Core with Implementation Examples', NULL, N'NONE', NULL, NULL, N'The NIST Cybersecurity Framework 2.0 Implementation Examples', '2023-08-08 00:00:00.000', NULL, N'This is the discussion draft of Implementation Examples (Examples) for the NIST Cybersecurity Framework (CSF or Framework) 2.0. It complements and is based on the Core from the NIST CSF 2.0 Initial Public Draft.', NULL, NULL, 0)
INSERT INTO [dbo].[GEN_FILE] ([Gen_File_Id], [File_Type_Id], [File_Name], [Title], [Name], [File_Size], [Doc_Num], [Comments], [Description], [Short_Name], [Publish_Date], [Doc_Version], [Summary], [Source_Type], [Data], [Is_Uploaded]) VALUES (692, 31, N'NIST.CSWP.29.ipd.pdf', N'The NIST Cybersecurity Framework 2.0 - Initial Public Draft', N'The NIST Cybersecurity Framework 2.0 - Initial Public Draft', NULL, N'NONE', NULL, NULL, N'The NIST Cybersecurity Framework 2.0 - Initial Public Draft', '2023-08-08 00:00:00.000', NULL, N'The NIST Cybersecurity Framework 2.0 provides guidance to industry, government agencies, 3 and other organizations to reduce cybersecurity risks. It offers a taxonomy of high-level 4 cybersecurity outcomes that can be used by any organization  regardless of its size, sector, or 5 maturity  to better understand, assess, prioritize, and communicate its cybersecurity efforts. 6 The Framework does not prescribe how outcomes should be achieved. Rather, it maps to 7 resources that provide additional guidance on practices and controls that could be used to achieve 8 those outcomes. This document explains Cybersecurity Framework 2.0 and its components and 9 describes some of the many ways that it can be used.', NULL, NULL, 0)
INSERT INTO [dbo].[GEN_FILE] ([Gen_File_Id], [File_Type_Id], [File_Name], [Title], [Name], [File_Size], [Doc_Num], [Comments], [Description], [Short_Name], [Publish_Date], [Doc_Version], [Summary], [Source_Type], [Data], [Is_Uploaded]) VALUES (6117, 31, N'cybersecurity-assessment-tool-espanol.pdf', N'Herramienta de Evaluacin de Ciberseguridad', N'Herramienta de Evaluacin de Ciberseguridad', 352256, N'NONE', NULL, NULL, N'Herramienta de Evaluacin de Ciberseguridad', NULL, NULL, NULL, NULL, NULL, 0)
INSERT INTO [dbo].[GEN_FILE] ([Gen_File_Id], [File_Type_Id], [File_Name], [Title], [Name], [File_Size], [Doc_Num], [Comments], [Description], [Short_Name], [Publish_Date], [Doc_Version], [Summary], [Source_Type], [Data], [Is_Uploaded]) VALUES (6118, 31, N'Due Diligence over 3rd Party Service Providers.pdf', N'Due Diligence over Third Party Service Providers', N'Due Diligence over Third Party Service Providers', 839680, N'LTCU 01-CU-20', NULL, NULL, N'Due Diligence over Third Party Service Providers', NULL, NULL, N'Credit Unions are increasingly partnering with outside parties to enhance the services provides to members. This is especially true in the lending arena where third-party relationships are opening the doors to less traditional programs such as leasing, indirect lending, and risk-based lending (also referred to as sub-priming lending). These arrangements can make programs more cost-effective, enable credit unions access to expertise that has not been developed in-house, and promote programs that may not be feasible if entered into independently. However, we are also aware of cases of third-party relationships resulting in financial stresses for credit unions due to unanticipated costs, legal disputes, and asset losses. Generally, these situations occured because the credit union either failed to exercise proper due diligence before entering into a relationship or failed to set up controls to monitor performance.', NULL, NULL, 0)
INSERT INTO [dbo].[GEN_FILE] ([Gen_File_Id], [File_Type_Id], [File_Name], [Title], [Name], [File_Size], [Doc_Num], [Comments], [Description], [Short_Name], [Publish_Date], [Doc_Version], [Summary], [Source_Type], [Data], [Is_Uploaded]) VALUES (7069, 31, N'Appendix B to Part 748_ Title 12 (up to date as of 9-28-2023).pdf', N'NCUA Appendix B', N'NCUA Appendix B', 81920, N'NONE', NULL, NULL, N'NCUA Appendix B', NULL, NULL, NULL, NULL, NULL, 0)
