INSERT INTO [dbo].[GEN_FILE] ([Gen_File_Id], [File_Type_Id], [File_Name], [Title], [Name], [File_Size], [Doc_Num], [Comments], [Description], [Short_Name], [Publish_Date], [Doc_Version], [Summary], [Source_Type], [Data], [Is_Uploaded]) VALUES (7073, 31, N'LTCU 23-CU-07 Cyber Incident Notification Requirements.pdf', N'Cyber Incident Notification Requirements', N'Cyber Incident Notification Requirements', 1343488, N'NONE', NULL, NULL, N'LTCU 23-CU-07', '2023-08-14 00:00:00.000', NULL, N'The Cyber Incident Notification Requirements rule defines a cyber incident as an occurrence that actually or imminently jeopardizes, without lawful authority, the integrity, confidentiality, or availability of information on an information system or actually or imminently jeopardizes, without lawful authority, an information system.', NULL, NULL, 0)
