INSERT INTO [dbo].[NEW_REQUIREMENT] ([Requirement_Id], [Requirement_Title], [Requirement_Text], [Supplemental_Info], [Standard_Category], [Standard_Sub_Category], [Weight], [Implementation_Recommendations], [Original_Set_Name], [NCSF_Cat_Id], [NCSF_Number], [Ranking], [Question_Group_Heading_Id], [ExaminationApproach], [Old_Id_For_Copy]) VALUES (36452, N'PR.AA-06', N'Physical access to assets is managed, monitored, and enforced commensurate with risk', N'<div><ul><li><b>Ex1:</b>  Use security guards, security cameras, locked entrances, alarm systems, and other physical controls to monitor facilities and restrict access </li>
INSERT INTO [dbo].[NEW_REQUIREMENT] ([Requirement_Id], [Requirement_Title], [Requirement_Text], [Supplemental_Info], [Standard_Category], [Standard_Sub_Category], [Weight], [Implementation_Recommendations], [Original_Set_Name], [NCSF_Cat_Id], [NCSF_Number], [Ranking], [Question_Group_Heading_Id], [ExaminationApproach], [Old_Id_For_Copy]) VALUES (36453, N'PR.DS-10', N'The confidentiality, integrity, and availability of data-in-use are protected', N'<div><ul><li><b>Ex1:</b>  Remove data that must remain confidential (e.g., from processors and memory) as soon as it is no longer needed </li>
INSERT INTO [dbo].[NEW_REQUIREMENT] ([Requirement_Id], [Requirement_Title], [Requirement_Text], [Supplemental_Info], [Standard_Category], [Standard_Sub_Category], [Weight], [Implementation_Recommendations], [Original_Set_Name], [NCSF_Cat_Id], [NCSF_Number], [Ranking], [Question_Group_Heading_Id], [ExaminationApproach], [Old_Id_For_Copy]) VALUES (36454, N'PR.DS-11', N'Backups of data are created, protected, maintained, and tested', N'<div><ul><li><b>Ex1:</b>  Continuously back up critical data in near-real-time, and back up other data frequently at agreed-upon schedules </li>
INSERT INTO [dbo].[NEW_REQUIREMENT] ([Requirement_Id], [Requirement_Title], [Requirement_Text], [Supplemental_Info], [Standard_Category], [Standard_Sub_Category], [Weight], [Implementation_Recommendations], [Original_Set_Name], [NCSF_Cat_Id], [NCSF_Number], [Ranking], [Question_Group_Heading_Id], [ExaminationApproach], [Old_Id_For_Copy]) VALUES (36455, N'PR.PS-01', N'Configuration management practices are applied', N'<div><ul><li><b>Ex1:</b>  Establish, test, deploy, and maintain hardened baselines that enforce the organization?s cybersecurity policies and provide only essential capabilities (i.e., principle of least functionality) </li>
INSERT INTO [dbo].[NEW_REQUIREMENT] ([Requirement_Id], [Requirement_Title], [Requirement_Text], [Supplemental_Info], [Standard_Category], [Standard_Sub_Category], [Weight], [Implementation_Recommendations], [Original_Set_Name], [NCSF_Cat_Id], [NCSF_Number], [Ranking], [Question_Group_Heading_Id], [ExaminationApproach], [Old_Id_For_Copy]) VALUES (36456, N'PR.PS-02', N'Software is maintained, replaced, and removed commensurate with risk', N'<div><ul><li><b>Ex1:</b>  Perform routine and emergency patching within the timeframes specified in the vulnerability management plan </li>
INSERT INTO [dbo].[NEW_REQUIREMENT] ([Requirement_Id], [Requirement_Title], [Requirement_Text], [Supplemental_Info], [Standard_Category], [Standard_Sub_Category], [Weight], [Implementation_Recommendations], [Original_Set_Name], [NCSF_Cat_Id], [NCSF_Number], [Ranking], [Question_Group_Heading_Id], [ExaminationApproach], [Old_Id_For_Copy]) VALUES (36457, N'PR.PS-03', N'Hardware is maintained, replaced, and removed commensurate with risk', N'<div><ul><li><b>Ex1:</b>  Replace hardware when it lacks needed security capabilities or when it cannot support software with needed security capabilities </li>
INSERT INTO [dbo].[NEW_REQUIREMENT] ([Requirement_Id], [Requirement_Title], [Requirement_Text], [Supplemental_Info], [Standard_Category], [Standard_Sub_Category], [Weight], [Implementation_Recommendations], [Original_Set_Name], [NCSF_Cat_Id], [NCSF_Number], [Ranking], [Question_Group_Heading_Id], [ExaminationApproach], [Old_Id_For_Copy]) VALUES (36458, N'PR.PS-04', N'Log records are generated and made available for continuous monitoring', N'<div><ul><li><b>Ex1:</b>  Configure all operating systems, applications, and services (including cloud-based services) to generate log records </li>
INSERT INTO [dbo].[NEW_REQUIREMENT] ([Requirement_Id], [Requirement_Title], [Requirement_Text], [Supplemental_Info], [Standard_Category], [Standard_Sub_Category], [Weight], [Implementation_Recommendations], [Original_Set_Name], [NCSF_Cat_Id], [NCSF_Number], [Ranking], [Question_Group_Heading_Id], [ExaminationApproach], [Old_Id_For_Copy]) VALUES (36459, N'PR.PS-05', N'Installation and execution of unauthorized software are prevented', N'<div><ul><li><b>Ex1:</b>  When risk warrants it, restrict software execution to permitted products only or deny the execution of prohibited and unauthorized software </li>
INSERT INTO [dbo].[NEW_REQUIREMENT] ([Requirement_Id], [Requirement_Title], [Requirement_Text], [Supplemental_Info], [Standard_Category], [Standard_Sub_Category], [Weight], [Implementation_Recommendations], [Original_Set_Name], [NCSF_Cat_Id], [NCSF_Number], [Ranking], [Question_Group_Heading_Id], [ExaminationApproach], [Old_Id_For_Copy]) VALUES (36460, N'PR.PS-06', N'Secure software development practices are integrated and their performance is monitored  throughout the software development life cycle', N'<div><ul><li><b>Ex1:</b>  Protect all components of organization-developed software from tampering and unauthorized access </li>
INSERT INTO [dbo].[NEW_REQUIREMENT] ([Requirement_Id], [Requirement_Title], [Requirement_Text], [Supplemental_Info], [Standard_Category], [Standard_Sub_Category], [Weight], [Implementation_Recommendations], [Original_Set_Name], [NCSF_Cat_Id], [NCSF_Number], [Ranking], [Question_Group_Heading_Id], [ExaminationApproach], [Old_Id_For_Copy]) VALUES (36461, N'PR.IR-01', N'Networks and environments are protected from unauthorized logical access and usage', N'<div><ul><li><b>Ex1:</b>  Logically segment organization networks and cloud-based platforms according to trust boundaries and platform types (e.g., IT, IoT, OT, mobile, guests), and permit required communications only between segments </li>
INSERT INTO [dbo].[NEW_REQUIREMENT] ([Requirement_Id], [Requirement_Title], [Requirement_Text], [Supplemental_Info], [Standard_Category], [Standard_Sub_Category], [Weight], [Implementation_Recommendations], [Original_Set_Name], [NCSF_Cat_Id], [NCSF_Number], [Ranking], [Question_Group_Heading_Id], [ExaminationApproach], [Old_Id_For_Copy]) VALUES (36462, N'PR.IR-02', N'The organization''s technology assets are protected from environmental threats', N'<div><ul><li><b>Ex1:</b>  Protect organizational equipment from known environmental threats, such as flooding, fire, wind, and excessive heat and humidity </li>
INSERT INTO [dbo].[NEW_REQUIREMENT] ([Requirement_Id], [Requirement_Title], [Requirement_Text], [Supplemental_Info], [Standard_Category], [Standard_Sub_Category], [Weight], [Implementation_Recommendations], [Original_Set_Name], [NCSF_Cat_Id], [NCSF_Number], [Ranking], [Question_Group_Heading_Id], [ExaminationApproach], [Old_Id_For_Copy]) VALUES (36463, N'PR.IR-03', N'Mechanisms are implemented to achieve resilience requirements in normal and adverse situations', NULL, N'Protect', N'Technology Infrastructure Resilience', NULL, NULL, N'NCSF_V2', NULL, NULL, NULL, 42, NULL, NULL)
INSERT INTO [dbo].[NEW_REQUIREMENT] ([Requirement_Id], [Requirement_Title], [Requirement_Text], [Supplemental_Info], [Standard_Category], [Standard_Sub_Category], [Weight], [Implementation_Recommendations], [Original_Set_Name], [NCSF_Cat_Id], [NCSF_Number], [Ranking], [Question_Group_Heading_Id], [ExaminationApproach], [Old_Id_For_Copy]) VALUES (36464, N'PR.IR-04', N'Adequate resource capacity to ensure availability is maintained', N'<div><ul><li><b>Ex1:</b>  Monitor usage of storage, power, compute, network bandwidth, and other resources </li>
INSERT INTO [dbo].[NEW_REQUIREMENT] ([Requirement_Id], [Requirement_Title], [Requirement_Text], [Supplemental_Info], [Standard_Category], [Standard_Sub_Category], [Weight], [Implementation_Recommendations], [Original_Set_Name], [NCSF_Cat_Id], [NCSF_Number], [Ranking], [Question_Group_Heading_Id], [ExaminationApproach], [Old_Id_For_Copy]) VALUES (36465, N'DE.AE-07', N'Cyber threat intelligence and other contextual information are integrated into the analysis', N'<div><ul><li><b>Ex1:</b>  Securely provide cyber threat intelligence feeds to detection technologies, processes, and personnel </li>
INSERT INTO [dbo].[NEW_REQUIREMENT] ([Requirement_Id], [Requirement_Title], [Requirement_Text], [Supplemental_Info], [Standard_Category], [Standard_Sub_Category], [Weight], [Implementation_Recommendations], [Original_Set_Name], [NCSF_Cat_Id], [NCSF_Number], [Ranking], [Question_Group_Heading_Id], [ExaminationApproach], [Old_Id_For_Copy]) VALUES (36466, N'DE.AE-08', N'Incidents are declared when adverse events meet the defined incident criteria', N'<div><ul><li><b>Ex1:</b>  Apply incident criteria to known and assumed characteristics of activity in order to determine whether an incident should be declared </li>
INSERT INTO [dbo].[NEW_REQUIREMENT] ([Requirement_Id], [Requirement_Title], [Requirement_Text], [Supplemental_Info], [Standard_Category], [Standard_Sub_Category], [Weight], [Implementation_Recommendations], [Original_Set_Name], [NCSF_Cat_Id], [NCSF_Number], [Ranking], [Question_Group_Heading_Id], [ExaminationApproach], [Old_Id_For_Copy]) VALUES (36467, N'DE.CM-09', N'Computing hardware and software, runtime environments, and their data are monitored to find  potentially adverse events', N'<div><ul><li><b>Ex1:</b>  Monitor email, web, file sharing, collaboration services, and other common attack vectors to detect malware, phishing, data leaks and exfiltration, and other adverse events </li>
INSERT INTO [dbo].[NEW_REQUIREMENT] ([Requirement_Id], [Requirement_Title], [Requirement_Text], [Supplemental_Info], [Standard_Category], [Standard_Sub_Category], [Weight], [Implementation_Recommendations], [Original_Set_Name], [NCSF_Cat_Id], [NCSF_Number], [Ranking], [Question_Group_Heading_Id], [ExaminationApproach], [Old_Id_For_Copy]) VALUES (36468, N'RS.MA-01', N'The incident response plan is executed once an incident is declared in coordination with relevant third parties', N'<div><ul><li><b>Ex1:</b>  Detection technologies automatically report confirmed incidents  </li>
INSERT INTO [dbo].[NEW_REQUIREMENT] ([Requirement_Id], [Requirement_Title], [Requirement_Text], [Supplemental_Info], [Standard_Category], [Standard_Sub_Category], [Weight], [Implementation_Recommendations], [Original_Set_Name], [NCSF_Cat_Id], [NCSF_Number], [Ranking], [Question_Group_Heading_Id], [ExaminationApproach], [Old_Id_For_Copy]) VALUES (36469, N'RS.MA-02', N'Incident reports are triaged and validated', N'<div><ul><li><b>Ex1:</b>  Preliminarily review incident reports to confirm that they are cybersecurity-related and necessitate incident response activities </li>
INSERT INTO [dbo].[NEW_REQUIREMENT] ([Requirement_Id], [Requirement_Title], [Requirement_Text], [Supplemental_Info], [Standard_Category], [Standard_Sub_Category], [Weight], [Implementation_Recommendations], [Original_Set_Name], [NCSF_Cat_Id], [NCSF_Number], [Ranking], [Question_Group_Heading_Id], [ExaminationApproach], [Old_Id_For_Copy]) VALUES (36470, N'RS.MA-03', N'Incidents are categorized and prioritized', N'<div><ul><li><b>Ex1:</b>  Further review and categorize incidents based on the type of incident (e.g., data breach, ransomware, DDoS, account compromise) </li>
INSERT INTO [dbo].[NEW_REQUIREMENT] ([Requirement_Id], [Requirement_Title], [Requirement_Text], [Supplemental_Info], [Standard_Category], [Standard_Sub_Category], [Weight], [Implementation_Recommendations], [Original_Set_Name], [NCSF_Cat_Id], [NCSF_Number], [Ranking], [Question_Group_Heading_Id], [ExaminationApproach], [Old_Id_For_Copy]) VALUES (36471, N'RS.MA-04', N'Incidents are escalated or elevated as needed', N'<div><ul><li><b>Ex1:</b>  Track and validate the status of all ongoing incidents </li>
INSERT INTO [dbo].[NEW_REQUIREMENT] ([Requirement_Id], [Requirement_Title], [Requirement_Text], [Supplemental_Info], [Standard_Category], [Standard_Sub_Category], [Weight], [Implementation_Recommendations], [Original_Set_Name], [NCSF_Cat_Id], [NCSF_Number], [Ranking], [Question_Group_Heading_Id], [ExaminationApproach], [Old_Id_For_Copy]) VALUES (36472, N'RS.MA-05', N'The criteria for initiating incident recovery are applied', N'<div><ul><li><b>Ex1:</b>  Apply incident recovery criteria to known and assumed characteristics of the incident to determine whether incident recovery processes should be initiated </li>
INSERT INTO [dbo].[NEW_REQUIREMENT] ([Requirement_Id], [Requirement_Title], [Requirement_Text], [Supplemental_Info], [Standard_Category], [Standard_Sub_Category], [Weight], [Implementation_Recommendations], [Original_Set_Name], [NCSF_Cat_Id], [NCSF_Number], [Ranking], [Question_Group_Heading_Id], [ExaminationApproach], [Old_Id_For_Copy]) VALUES (36473, N'RS.AN-06', N'Actions performed during an investigation are recorded and the records integrity and  provenance are preserved', N'<div><ul><li><b>Ex1:</b>  Require each incident responder and others (e.g., system administrators, cybersecurity engineers) who perform incident response tasks to record their actions and make the record immutable </li>
INSERT INTO [dbo].[NEW_REQUIREMENT] ([Requirement_Id], [Requirement_Title], [Requirement_Text], [Supplemental_Info], [Standard_Category], [Standard_Sub_Category], [Weight], [Implementation_Recommendations], [Original_Set_Name], [NCSF_Cat_Id], [NCSF_Number], [Ranking], [Question_Group_Heading_Id], [ExaminationApproach], [Old_Id_For_Copy]) VALUES (36474, N'RS.AN-07', N'Incident data and metadata are collected, and their integrity and provenance are preserved', N'<div><ul><li><b>Ex1:</b>  Collect, preserve, and safeguard the integrity of all pertinent incident data and metadata (e.g., data source, date/time of collection) based on evidence preservation and chain-of-custody procedures   </li>
INSERT INTO [dbo].[NEW_REQUIREMENT] ([Requirement_Id], [Requirement_Title], [Requirement_Text], [Supplemental_Info], [Standard_Category], [Standard_Sub_Category], [Weight], [Implementation_Recommendations], [Original_Set_Name], [NCSF_Cat_Id], [NCSF_Number], [Ranking], [Question_Group_Heading_Id], [ExaminationApproach], [Old_Id_For_Copy]) VALUES (36475, N'RS.AN-08', N'The incident''s magnitude is estimated and validated', N'<div><ul><li><b>Ex1:</b>  Review other potential targets of the incident to search for indicators of compromise and evidence of persistence </li>
INSERT INTO [dbo].[NEW_REQUIREMENT] ([Requirement_Id], [Requirement_Title], [Requirement_Text], [Supplemental_Info], [Standard_Category], [Standard_Sub_Category], [Weight], [Implementation_Recommendations], [Original_Set_Name], [NCSF_Cat_Id], [NCSF_Number], [Ranking], [Question_Group_Heading_Id], [ExaminationApproach], [Old_Id_For_Copy]) VALUES (36476, N'RC.RP-06', N'The criteria for determining the end of incident recovery are applied, and incident-related documentation is completed', N'<div><ul><li><b>Ex1:</b>  Prepare an after-action report that documents the incident itself, the response and recovery actions taken, and lessons learned </li>
INSERT INTO [dbo].[NEW_REQUIREMENT] ([Requirement_Id], [Requirement_Title], [Requirement_Text], [Supplemental_Info], [Standard_Category], [Standard_Sub_Category], [Weight], [Implementation_Recommendations], [Original_Set_Name], [NCSF_Cat_Id], [NCSF_Number], [Ranking], [Question_Group_Heading_Id], [ExaminationApproach], [Old_Id_For_Copy]) VALUES (36477, N'RC.CO-04', N'Public updates on incident recovery are properly shared using approved methods and messaging', N'<div><ul><li><b>Ex1:</b>  Follow the organization?s breach notification procedures for recovering from a data breach incident </li>
INSERT INTO [dbo].[NEW_REQUIREMENT] ([Requirement_Id], [Requirement_Title], [Requirement_Text], [Supplemental_Info], [Standard_Category], [Standard_Sub_Category], [Weight], [Implementation_Recommendations], [Original_Set_Name], [NCSF_Cat_Id], [NCSF_Number], [Ranking], [Question_Group_Heading_Id], [ExaminationApproach], [Old_Id_For_Copy]) VALUES (36478, N'GV.OC-01', N'The organizational mission is understood and informs cybersecurity risk management', N'<div><ul><li><b>Ex1:</b>  Share the organization?s mission (e.g., through vision and mission statements, marketing, and service strategies) to provide a basis for identifying risks that may impede that mission   </li>
INSERT INTO [dbo].[NEW_REQUIREMENT] ([Requirement_Id], [Requirement_Title], [Requirement_Text], [Supplemental_Info], [Standard_Category], [Standard_Sub_Category], [Weight], [Implementation_Recommendations], [Original_Set_Name], [NCSF_Cat_Id], [NCSF_Number], [Ranking], [Question_Group_Heading_Id], [ExaminationApproach], [Old_Id_For_Copy]) VALUES (36479, N'GV.OC-02', N'Internal and external stakeholders are determined, and their needs and expectations regarding  cybersecurity risk management are understood', N'<div><ul><li><b>Ex1:</b>  Identify relevant internal stakeholders and their cybersecurity-related expectations (e.g., performance and risk expectations of officers, directors, and advisors; cultural expectations of employees) </li>
INSERT INTO [dbo].[NEW_REQUIREMENT] ([Requirement_Id], [Requirement_Title], [Requirement_Text], [Supplemental_Info], [Standard_Category], [Standard_Sub_Category], [Weight], [Implementation_Recommendations], [Original_Set_Name], [NCSF_Cat_Id], [NCSF_Number], [Ranking], [Question_Group_Heading_Id], [ExaminationApproach], [Old_Id_For_Copy]) VALUES (36480, N'GV.OC-03', N'Legal, regulatory, and contractual requirements regarding cybersecurity -- including privacy  and civil liberties obligations -- are understood and managed', N'<div><ul><li><b>Ex1:</b>  Determine a process to track and manage legal and regulatory requirements regarding protection of individuals? information (e.g., Health Insurance Portability and Accountability Act, California Consumer Privacy Act, General Data Protection Regulation)  </li>
INSERT INTO [dbo].[NEW_REQUIREMENT] ([Requirement_Id], [Requirement_Title], [Requirement_Text], [Supplemental_Info], [Standard_Category], [Standard_Sub_Category], [Weight], [Implementation_Recommendations], [Original_Set_Name], [NCSF_Cat_Id], [NCSF_Number], [Ranking], [Question_Group_Heading_Id], [ExaminationApproach], [Old_Id_For_Copy]) VALUES (36481, N'GV.OC-04', N'Critical objectives, capabilities, and services that stakeholders depend on or expect from the  organization are determined and communicated', N'<div><ul><li><b>Ex1:</b>  Establish criteria for determining the criticality of capabilities and services as viewed by internal and external stakeholders </li>
INSERT INTO [dbo].[NEW_REQUIREMENT] ([Requirement_Id], [Requirement_Title], [Requirement_Text], [Supplemental_Info], [Standard_Category], [Standard_Sub_Category], [Weight], [Implementation_Recommendations], [Original_Set_Name], [NCSF_Cat_Id], [NCSF_Number], [Ranking], [Question_Group_Heading_Id], [ExaminationApproach], [Old_Id_For_Copy]) VALUES (36482, N'GV.OC-05', N'Outcomes, capabilities, and services that the organization depends on are determined and communicated', N'<div><ul><li><b>Ex1:</b>  Create an inventory of the organization?s dependencies on external resources (e.g., facilities, cloud-based hosting providers) and their relationships to organizational assets and business functions </li>
INSERT INTO [dbo].[NEW_REQUIREMENT] ([Requirement_Id], [Requirement_Title], [Requirement_Text], [Supplemental_Info], [Standard_Category], [Standard_Sub_Category], [Weight], [Implementation_Recommendations], [Original_Set_Name], [NCSF_Cat_Id], [NCSF_Number], [Ranking], [Question_Group_Heading_Id], [ExaminationApproach], [Old_Id_For_Copy]) VALUES (36483, N'GV.RM-01', N'Risk management objectives are established and agreed to by organizational stakeholders', N'<div><ul><li><b>Ex1:</b>  Update near-term and long-term cybersecurity risk management objectives as part of annual strategic planning and when major changes occur </li>
INSERT INTO [dbo].[NEW_REQUIREMENT] ([Requirement_Id], [Requirement_Title], [Requirement_Text], [Supplemental_Info], [Standard_Category], [Standard_Sub_Category], [Weight], [Implementation_Recommendations], [Original_Set_Name], [NCSF_Cat_Id], [NCSF_Number], [Ranking], [Question_Group_Heading_Id], [ExaminationApproach], [Old_Id_For_Copy]) VALUES (36484, N'GV.RM-02', N'Risk appetite and risk tolerance statements are determined, communicated, and maintained', N'<div><ul><li><b>Ex1:</b>  Determine and communicate risk appetite statements that convey expectations about the appropriate level of risk for the organization </li>
INSERT INTO [dbo].[NEW_REQUIREMENT] ([Requirement_Id], [Requirement_Title], [Requirement_Text], [Supplemental_Info], [Standard_Category], [Standard_Sub_Category], [Weight], [Implementation_Recommendations], [Original_Set_Name], [NCSF_Cat_Id], [NCSF_Number], [Ranking], [Question_Group_Heading_Id], [ExaminationApproach], [Old_Id_For_Copy]) VALUES (36485, N'GV.RM-03', N'Enterprise risk management processes include cybersecurity risk management activities and outcomes', N'<div><ul><li><b>Ex1:</b>  Aggregate and manage cybersecurity risks alongside other enterprise risks (e.g., compliance, financial, regulatory) </li>
INSERT INTO [dbo].[NEW_REQUIREMENT] ([Requirement_Id], [Requirement_Title], [Requirement_Text], [Supplemental_Info], [Standard_Category], [Standard_Sub_Category], [Weight], [Implementation_Recommendations], [Original_Set_Name], [NCSF_Cat_Id], [NCSF_Number], [Ranking], [Question_Group_Heading_Id], [ExaminationApproach], [Old_Id_For_Copy]) VALUES (36486, N'GV.RM-04', N'Strategic direction that describes appropriate risk response options is established and communicated', N'<div><ul><li><b>Ex1:</b>  Specify criteria for accepting and avoiding cybersecurity risk for various classifications of data </li>
INSERT INTO [dbo].[NEW_REQUIREMENT] ([Requirement_Id], [Requirement_Title], [Requirement_Text], [Supplemental_Info], [Standard_Category], [Standard_Sub_Category], [Weight], [Implementation_Recommendations], [Original_Set_Name], [NCSF_Cat_Id], [NCSF_Number], [Ranking], [Question_Group_Heading_Id], [ExaminationApproach], [Old_Id_For_Copy]) VALUES (36487, N'GV.RM-05', N'Lines of communication across the organization are established for cybersecurity risks, including risks from suppliers and other third parties', N'<div><ul><li><b>Ex1:</b>  Determine how to update senior executives, directors, and management on the organization?s cybersecurity posture at agreed-upon intervals </li>
INSERT INTO [dbo].[NEW_REQUIREMENT] ([Requirement_Id], [Requirement_Title], [Requirement_Text], [Supplemental_Info], [Standard_Category], [Standard_Sub_Category], [Weight], [Implementation_Recommendations], [Original_Set_Name], [NCSF_Cat_Id], [NCSF_Number], [Ranking], [Question_Group_Heading_Id], [ExaminationApproach], [Old_Id_For_Copy]) VALUES (36488, N'GV.RM-06', N'A standardized method for calculating, documenting, categorizing, and prioritizing cybersecurity risks is established and communicated', N'<div><ul><li><b>Ex1:</b>  Establish criteria for using a quantitative approach to cybersecurity risk analysis, and specify probability and exposure formulas </li>
INSERT INTO [dbo].[NEW_REQUIREMENT] ([Requirement_Id], [Requirement_Title], [Requirement_Text], [Supplemental_Info], [Standard_Category], [Standard_Sub_Category], [Weight], [Implementation_Recommendations], [Original_Set_Name], [NCSF_Cat_Id], [NCSF_Number], [Ranking], [Question_Group_Heading_Id], [ExaminationApproach], [Old_Id_For_Copy]) VALUES (36489, N'GV.RM-07', N'Strategic opportunities (i.e., positive risks) are identified and included in organizational cybersecurity risk discussions', N'<div><ul><li><b>Ex1:</b>  Define and communicate guidance and methods for identifying opportunities and including them in risk discussions (e.g., strengths, weaknesses, opportunities, and threats [SWOT] analysis) </li>
INSERT INTO [dbo].[NEW_REQUIREMENT] ([Requirement_Id], [Requirement_Title], [Requirement_Text], [Supplemental_Info], [Standard_Category], [Standard_Sub_Category], [Weight], [Implementation_Recommendations], [Original_Set_Name], [NCSF_Cat_Id], [NCSF_Number], [Ranking], [Question_Group_Heading_Id], [ExaminationApproach], [Old_Id_For_Copy]) VALUES (36490, N'GV.SC-01', N'A cybersecurity supply chain risk management program, strategy, objectives, policies, and  processes are established and agreed to by organizational stakeholders', N'<div><ul><li><b>Ex1:</b>  Establish a strategy that expresses the objectives of the cybersecurity supply chain risk management program </li>
INSERT INTO [dbo].[NEW_REQUIREMENT] ([Requirement_Id], [Requirement_Title], [Requirement_Text], [Supplemental_Info], [Standard_Category], [Standard_Sub_Category], [Weight], [Implementation_Recommendations], [Original_Set_Name], [NCSF_Cat_Id], [NCSF_Number], [Ranking], [Question_Group_Heading_Id], [ExaminationApproach], [Old_Id_For_Copy]) VALUES (36491, N'GV.SC-02', N'Cybersecurity roles and responsibilities for suppliers, customers, and partners are established,  communicated, and coordinated internally and externally', N'<div><ul><li><b>Ex1:</b>  Identify one or more specific roles or positions that will be responsible and accountable for planning, resourcing, and executing cybersecurity supply chain risk management activities </li>
INSERT INTO [dbo].[NEW_REQUIREMENT] ([Requirement_Id], [Requirement_Title], [Requirement_Text], [Supplemental_Info], [Standard_Category], [Standard_Sub_Category], [Weight], [Implementation_Recommendations], [Original_Set_Name], [NCSF_Cat_Id], [NCSF_Number], [Ranking], [Question_Group_Heading_Id], [ExaminationApproach], [Old_Id_For_Copy]) VALUES (36492, N'GV.SC-03', N'Cybersecurity supply chain risk management is integrated into cybersecurity and enterprise risk  management, risk assessment, and improvement processes', N'<div><ul><li><b>Ex1:</b>  Identify areas of alignment and overlap with cybersecurity and enterprise risk management </li>
INSERT INTO [dbo].[NEW_REQUIREMENT] ([Requirement_Id], [Requirement_Title], [Requirement_Text], [Supplemental_Info], [Standard_Category], [Standard_Sub_Category], [Weight], [Implementation_Recommendations], [Original_Set_Name], [NCSF_Cat_Id], [NCSF_Number], [Ranking], [Question_Group_Heading_Id], [ExaminationApproach], [Old_Id_For_Copy]) VALUES (36493, N'GV.SC-04', N'Suppliers are known and prioritized by criticality', N'<div><ul><li><b>Ex1:</b>  Develop criteria for supplier criticality based on, for example, the sensitivity of data processed or possessed by suppliers, the degree of access to the organization?s systems, and the importance of the products or services to the organization?s mission </li>
INSERT INTO [dbo].[NEW_REQUIREMENT] ([Requirement_Id], [Requirement_Title], [Requirement_Text], [Supplemental_Info], [Standard_Category], [Standard_Sub_Category], [Weight], [Implementation_Recommendations], [Original_Set_Name], [NCSF_Cat_Id], [NCSF_Number], [Ranking], [Question_Group_Heading_Id], [ExaminationApproach], [Old_Id_For_Copy]) VALUES (36494, N'GV.SC-05', N'Requirements to address cybersecurity risks in supply chains are established, prioritized, and  integrated into contracts and other types of agreements with suppliers and other relevant third parties', N'<div><ul><li><b>Ex1:</b>  Establish security requirements for suppliers, products, and services commensurate with their criticality level and potential impact if compromised </li>
INSERT INTO [dbo].[NEW_REQUIREMENT] ([Requirement_Id], [Requirement_Title], [Requirement_Text], [Supplemental_Info], [Standard_Category], [Standard_Sub_Category], [Weight], [Implementation_Recommendations], [Original_Set_Name], [NCSF_Cat_Id], [NCSF_Number], [Ranking], [Question_Group_Heading_Id], [ExaminationApproach], [Old_Id_For_Copy]) VALUES (36495, N'GV.SC-06', N'Planning and due diligence are performed to reduce risks before entering into formal supplier or  other third-party relationships', NULL, N'Govern', N'Cybersecurity Supply Chain Risk Management', NULL, NULL, N'NCSF_V2', NULL, NULL, NULL, 41, NULL, NULL)
INSERT INTO [dbo].[NEW_REQUIREMENT] ([Requirement_Id], [Requirement_Title], [Requirement_Text], [Supplemental_Info], [Standard_Category], [Standard_Sub_Category], [Weight], [Implementation_Recommendations], [Original_Set_Name], [NCSF_Cat_Id], [NCSF_Number], [Ranking], [Question_Group_Heading_Id], [ExaminationApproach], [Old_Id_For_Copy]) VALUES (36496, N'GV.SC-07', N'The risks posed by a supplier, their products and services, and other third parties are identified,  recorded, prioritized, assessed, responded to, and monitored over the course of the relationship', N'<div><ul><li><b>Ex1:</b>  Adjust assessment formats and frequencies based on the third party?s reputation and the criticality of the products or services they provide </li>
INSERT INTO [dbo].[NEW_REQUIREMENT] ([Requirement_Id], [Requirement_Title], [Requirement_Text], [Supplemental_Info], [Standard_Category], [Standard_Sub_Category], [Weight], [Implementation_Recommendations], [Original_Set_Name], [NCSF_Cat_Id], [NCSF_Number], [Ranking], [Question_Group_Heading_Id], [ExaminationApproach], [Old_Id_For_Copy]) VALUES (36497, N'GV.SC-08', N'Relevant suppliers and other third parties are included in incident planning, response, and  recovery activities', N'<div><ul><li><b>Ex1:</b>  Define and use rules and protocols for reporting incident response and recovery activities and the status between the organization and its suppliers </li>
INSERT INTO [dbo].[NEW_REQUIREMENT] ([Requirement_Id], [Requirement_Title], [Requirement_Text], [Supplemental_Info], [Standard_Category], [Standard_Sub_Category], [Weight], [Implementation_Recommendations], [Original_Set_Name], [NCSF_Cat_Id], [NCSF_Number], [Ranking], [Question_Group_Heading_Id], [ExaminationApproach], [Old_Id_For_Copy]) VALUES (36498, N'GV.SC-09', N'Supply chain security practices are integrated into cybersecurity and enterprise risk management  programs, and their performance is monitored throughout the technology product and service life cycle', N'<div><ul><li><b>Ex5:</b> service life cycle </li>
INSERT INTO [dbo].[NEW_REQUIREMENT] ([Requirement_Id], [Requirement_Title], [Requirement_Text], [Supplemental_Info], [Standard_Category], [Standard_Sub_Category], [Weight], [Implementation_Recommendations], [Original_Set_Name], [NCSF_Cat_Id], [NCSF_Number], [Ranking], [Question_Group_Heading_Id], [ExaminationApproach], [Old_Id_For_Copy]) VALUES (36499, N'GV.SC-10', N'Cybersecurity supply chain risk management plans include provisions for activities that occur  after the conclusion of a partnership or service agreement', N'<div><ul><li><b>Ex1:</b>  Establish processes for terminating critical relationships under both normal and adverse circumstances </li>
INSERT INTO [dbo].[NEW_REQUIREMENT] ([Requirement_Id], [Requirement_Title], [Requirement_Text], [Supplemental_Info], [Standard_Category], [Standard_Sub_Category], [Weight], [Implementation_Recommendations], [Original_Set_Name], [NCSF_Cat_Id], [NCSF_Number], [Ranking], [Question_Group_Heading_Id], [ExaminationApproach], [Old_Id_For_Copy]) VALUES (36500, N'GV.RR-01', N'Organizational leadership is responsible and accountable for cybersecurity risk and fosters a  culture that is risk-aware, ethical, and continually improving', N'<div><ul><li><b>Ex1:</b>  Leaders (e.g., directors) agree on their roles and responsibilities in developing, implementing, and assessing the organization?s cybersecurity strategy </li>
INSERT INTO [dbo].[NEW_REQUIREMENT] ([Requirement_Id], [Requirement_Title], [Requirement_Text], [Supplemental_Info], [Standard_Category], [Standard_Sub_Category], [Weight], [Implementation_Recommendations], [Original_Set_Name], [NCSF_Cat_Id], [NCSF_Number], [Ranking], [Question_Group_Heading_Id], [ExaminationApproach], [Old_Id_For_Copy]) VALUES (36501, N'GV.RR-02', N'Roles, responsibilities, and authorities related to cybersecurity risk management are established,  communicated, understood, and enforced', N'<div><ul><li><b>Ex1:</b>  Document risk management roles and responsibilities in policy </li>
INSERT INTO [dbo].[NEW_REQUIREMENT] ([Requirement_Id], [Requirement_Title], [Requirement_Text], [Supplemental_Info], [Standard_Category], [Standard_Sub_Category], [Weight], [Implementation_Recommendations], [Original_Set_Name], [NCSF_Cat_Id], [NCSF_Number], [Ranking], [Question_Group_Heading_Id], [ExaminationApproach], [Old_Id_For_Copy]) VALUES (36502, N'GV.RR-03', N'Adequate resources are allocated commensurate with cybersecurity risk strategy, roles and  responsibilities, and policies', N'<div><ul><li><b>Ex1:</b>  Conduct periodic management reviews to ensure that those given cybersecurity risk management responsibilities have the necessary authority  </li>
INSERT INTO [dbo].[NEW_REQUIREMENT] ([Requirement_Id], [Requirement_Title], [Requirement_Text], [Supplemental_Info], [Standard_Category], [Standard_Sub_Category], [Weight], [Implementation_Recommendations], [Original_Set_Name], [NCSF_Cat_Id], [NCSF_Number], [Ranking], [Question_Group_Heading_Id], [ExaminationApproach], [Old_Id_For_Copy]) VALUES (36503, N'GV.RR-04', N'Cybersecurity is included in human resources practices', N'<div><ul><li><b>Ex1:</b>  Integrate cybersecurity risk management considerations into human resources processes (e.g., personnel screening, onboarding, change notification, offboarding)  </li>
INSERT INTO [dbo].[NEW_REQUIREMENT] ([Requirement_Id], [Requirement_Title], [Requirement_Text], [Supplemental_Info], [Standard_Category], [Standard_Sub_Category], [Weight], [Implementation_Recommendations], [Original_Set_Name], [NCSF_Cat_Id], [NCSF_Number], [Ranking], [Question_Group_Heading_Id], [ExaminationApproach], [Old_Id_For_Copy]) VALUES (36504, N'GV.PO-01', N'Policies, processes, and procedures for managing cybersecurity risks are established based on  organizational context, cybersecurity strategy, and priorities and are communicated and enforced', N'<div><ul><li><b>Ex1:</b>  Create, disseminate, and maintain a risk management policy with statements of management intent, expectations, and direction </li>
INSERT INTO [dbo].[NEW_REQUIREMENT] ([Requirement_Id], [Requirement_Title], [Requirement_Text], [Supplemental_Info], [Standard_Category], [Standard_Sub_Category], [Weight], [Implementation_Recommendations], [Original_Set_Name], [NCSF_Cat_Id], [NCSF_Number], [Ranking], [Question_Group_Heading_Id], [ExaminationApproach], [Old_Id_For_Copy]) VALUES (36505, N'GV.PO-02', N'Policies, processes, and procedures for managing cybersecurity risks are reviewed, updated,  communicated, and enforced to reflect changes in requirements, threats, technology, and organizational mission', N'<div><ul><li><b>Ex1:</b>  Update policies based on periodic reviews of cybersecurity risk management results to ensure that policies and supporting processes adequately maintain risk at an acceptable level </li>
INSERT INTO [dbo].[NEW_REQUIREMENT] ([Requirement_Id], [Requirement_Title], [Requirement_Text], [Supplemental_Info], [Standard_Category], [Standard_Sub_Category], [Weight], [Implementation_Recommendations], [Original_Set_Name], [NCSF_Cat_Id], [NCSF_Number], [Ranking], [Question_Group_Heading_Id], [ExaminationApproach], [Old_Id_For_Copy]) VALUES (36506, N'GV.OV-01', N'Cybersecurity risk management strategy outcomes are reviewed to inform and adjust strategy and direction', N'<div><ul><li><b>Ex1:</b>  Measure how well the risk management strategy and risk results have helped leaders make decisions and achieve organizational objectives </li>
INSERT INTO [dbo].[NEW_REQUIREMENT] ([Requirement_Id], [Requirement_Title], [Requirement_Text], [Supplemental_Info], [Standard_Category], [Standard_Sub_Category], [Weight], [Implementation_Recommendations], [Original_Set_Name], [NCSF_Cat_Id], [NCSF_Number], [Ranking], [Question_Group_Heading_Id], [ExaminationApproach], [Old_Id_For_Copy]) VALUES (36507, N'GV.OV-02', N'The cybersecurity risk management strategy is reviewed and adjusted to ensure coverage of organizational requirements and risks', N'<div><ul><li><b>Ex1:</b>  Review audit findings to confirm whether the existing cybersecurity strategy has ensured compliance with internal and external requirements </li>
INSERT INTO [dbo].[NEW_REQUIREMENT] ([Requirement_Id], [Requirement_Title], [Requirement_Text], [Supplemental_Info], [Standard_Category], [Standard_Sub_Category], [Weight], [Implementation_Recommendations], [Original_Set_Name], [NCSF_Cat_Id], [NCSF_Number], [Ranking], [Question_Group_Heading_Id], [ExaminationApproach], [Old_Id_For_Copy]) VALUES (36508, N'GV.OV-03', N'Organizational cybersecurity risk management performance is measured and reviewed to confirm and adjust strategic direction', N'<div><ul><li><b>Ex1:</b>  Review key performance indicators (KPIs) to ensure that organization-wide policies and procedures achieve objectives </li>
